import React from "react";

function Jumbotron({ title }) {
  return (
    <div
      style={{ height: 70, clear: "both", paddingTop: 10, textAlign: "center" }}
      className="jumbotron"
    >
      {title}
    </div>
  );
}

export default Jumbotron;
